import React from "react";
import "./MenuPrincipal.css"


function MenuPrincial(): JSX.Element{


    return (

      <div>
      <label className="barra">Equipo Primer Ingreso</label>
        <button style = {{position: 'absolute', top: 200, left: 700, fontSize: 25, fontWeight: 'bold'}} className = 'botonMenuPrincipal'> Gestionar Personal </button>
        <button style = {{position: 'absolute', top: 300, left: 700, fontSize: 25, fontWeight: 'bold'}} className = 'botonMenuPrincipal'> Plan de Trabajo </button>
        <button style = {{position: 'absolute', top: 400, left: 700, fontSize: 25, fontWeight: 'bold'}} className = 'botonMenuPrincipal'> Consultas </button>
        <button style = {{position: 'absolute', top: 500, left: 700, fontSize: 25, fontWeight: 'bold'}} className = 'botonMenuPrincipal'> Estudiantes </button>
        <button style = {{position: 'absolute', top: 600, left: 700, fontSize: 25, fontWeight: 'bold'}} className = 'botonMenuPrincipal'> Equipo de Trabajo </button>
        <button className = 'botonSalir'> Salir </button>
    </div>
    )



}

export default MenuPrincial;
